void P2P(unsigned int i, unsigned int j, std::vector<Particle> &particles, std::vector<double> &Bx, std::vector<double> &By, std::vector<double> &Bz) {
        double dx = particles[i].x - particles[j].x;
        double dy = particles[i].y - particles[j].y;
        double dz = particles[i].z - particles[j].z;
        double r2 = dx * dx + dy * dy + dz * dz;
        if (r2 != 0) {
            double r3 = sqrt(r2)*r2;
            double r5 = r3*r2;
            // # 3 * (mu.r)*r / r**5 - mu / r**3
            double mudotr = dx * particles[j].mux + dy * particles[j].muy + dz * particles[j].muz;

            Bx[i] += 3*mudotr*dx / r5 - particles[j].mux / r3;
            By[i] += 3*mudotr*dy / r5 - particles[j].muy / r3;
            Bz[i] += 3*mudotr*dz / r5 - particles[j].muz / r3;
        }
    }

void P2M(std::vector<Particle> &particles, unsigned int p, std::vector<Cell> &cells, unsigned int ncrit, unsigned int exporder) {
    switch(exporder) {

        case 0:
            P2M_0(particles, p, cells, ncrit);
            break;
        
        case 1:
            P2M_1(particles, p, cells, ncrit);
            break;
        
        case 2:
            P2M_2(particles, p, cells, ncrit);
            break;
        
        case 3:
            P2M_3(particles, p, cells, ncrit);
            break;
        
        case 4:
            P2M_4(particles, p, cells, ncrit);
            break;
        
        case 5:
            P2M_5(particles, p, cells, ncrit);
            break;
        
        case 6:
            P2M_6(particles, p, cells, ncrit);
            break;
        
        case 7:
            P2M_7(particles, p, cells, ncrit);
            break;
        
        default:
            throw std::invalid_argument("P2M: Regenerate the code with higher expansions");
    }
}

